import { Banco }  from "../api/banco";
import { MyFunctions } from "../../lib/mainSapso.js";
import {CufonA} from "./shared/cufon-yui.js";
import {Arial} from "./shared/arial.js";
//import {Cuf} from "./shared/cuf-run.js";
//import backgroundUrl from "~/assets/testeImage.png"; not 

//import images from "./shared/img/images.jpg" (not working) 

export default{
	name: 'App',
	data() {
		return { 
			string: '',
			number: '',
			number2: '',
			number3: '',
			//backgroundUrl,
			image: 'data:image/jpeg;base64,' //working
		};
	},
	methods: {

		//testando utilizar as funções de um outro arquivo - methods.js (deu certo!)
		handleClick: function(string){
			MyFunctions.addNewTodo(MyFunctions.MyFunction(this.string));

		},
		handleTeste: function(number, number2){
			MyFunctions.myTeste(this.number, this.number2);
		},
		handleTeste1: function(number3){
			MyFunctions.teste1(this.number3);
		}

	},
	meteor: {

		//mostrando os dados na pagina! (sem filtro)
		banco() {
			return Banco.find({}).fetch()
		}
	}

};
